import React from "react";
import computerImgTop from "../images/pexelsComputerTop.jpg";
import computerImgMid1 from "../images/pexelsComputerMid1.jpg";
import computerImgMid2 from "../images/pexelsComputerMid2.jpg";
import computerImgBottom from "../images/pexelsComputerBottom.jpg";

export default function Home(props) {
  return (
    <>
      <div className="homeHeader">
        <div className="homeLeft">
          <h1 className="homeLeftTitle">Welcome To My Portfolio</h1>
          /*<svg className="homeLeftSvg"></svg>*/
          <div className="homeRight">
            <img
              src={computerImgTop}
              className="computerImg imgTop"
              alt="Computer Top"
            ></img>
            <img
              src={computerImgMid1}
              className="computerImg imgMid1"
              alt="Computer Mid"
            ></img>
            <img
              src={computerImgMid2}
              className="computerImg imgMid2"
              alt="Computer Mid Second"
            ></img>
            <img
              src={computerImgBottom}
              className="computerImg imgBottom"
              alt="Computer Bottom"
            ></img>
          </div>
          <p className="homeLeftText">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua. Eget
            duis at tellus at urna condimentum mattis. Enim blandit volutpat
            maecenas volutpat blandit aliquam etiam erat velit.
          </p>
          <button className="homeLeftBtn" onClick={props.showHome}>
            Learn More
          </button>
        </div>
      </div>
    </>
  );
}
